package bean;

public class Engine {
	private String etype;
	private int eid;
	
	public Engine() {
		super();
		// TODO Auto-generated constructor stub
	}
	public String getEtype() {
		return etype;
	}
	public void setEtype(String etype) {
		this.etype = etype;
	}
	public int getEid() {
		return eid;
	}
	public void setEid(int eid) {
		this.eid = eid;
	}
	public String display() {
		return "Engine [etype=" + etype + ", eid=" + eid + "]";
	}
	public Engine(String etype, int eid) {
		super();
		this.etype = etype;
		this.eid = eid;
	}
	

}
